import React from 'react';
import './Exercise.css'


const Exercise = (props) => {
    const { name, img, time } = props.exercise;
    return (
        <div className='exercise'>
            <img src={img} alt="" srcset="" />
            <h1>{name}</h1>
            <p>{time}</p>
        </div>
    );
};

export default Exercise;
